import ReactDOM from "react-dom";
import "bootstrap/dist/css/bootstrap.css"


class Quote extends Component{
    render(){
        return(
            <div className="container">
            Hello
            </div>
        );
    }
}

ReactDOM.render(<Quote/>, document.getElementById("root"))
